        ResourceType.Document,
        OperationType.Query,
        "42",
        uri1.Uri);

    TraceWriterBaselineTests.GetPrivateField<List<StoreResponseStatistics>>(datum, "storeResponseStatistics").Add(storeResponseStatistics);
    rootTrace.AddDatum("Client Side Request Stats", datum);
}

